import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../Components/CSS/Dashboard.css'; // Ensure you have CSS file for styles

function CustomerDashboard() {

    const navigate = useNavigate();
    const handleLogout = () => {
        // Perform any necessary logout operations, e.g., clearing tokens
        localStorage.removeItem('token'); // Example: removing a token from local storage
    
        // Redirect to login page
        navigate('/login');
      };

  return (
    <div className="dashboard-container">
      <div className="sidebar">
        <h2>BookBliss</h2>
        <ul class="nav justify-content-end">
  <li class="nav-item">
    <a class="nav-link active" aria-current="page" href="#">Active</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="#">Link</a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="#">Link</a>
  </li>
  <li class="nav-item">
    <a class="nav-link disabled" aria-disabled="true">Disabled</a>
  </li>
</ul>
        <button onClick={handleLogout} className="btn btn-danger logout-btn">
          Logout
        </button>
      </div>
      <div className="content">
        {/* Content of the dashboard */}
        <h1>Welcome to your BookBliss!</h1>
        {/* Add more content here as needed */}
      </div>
    </div>
  );
}

export default CustomerDashboard;
